
<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<title>VaLion Premium Portal v14</title>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<style>
  :root {
    --dark: #0d0d0e;
    --light: #f5f5f5;
    --gold: #B08E4C;
    --gold-dark: #8e6f3c;
    --text-dark: #2a2d28;
    --text-light: #ffffff;
    --accent: #ece8e3;
    --transition: 0.3s ease;
    --radius: 14px;
    --primary-font: 'Helvetica Neue', Arial, sans-serif;
    --secondary-font: 'Georgia', serif;
  }
  *, *::before, *::after { box-sizing: border-box; margin:0; padding:0; }
  body { font-family: var(--primary-font); background: var(--light); color: var(--text-dark); display: flex; flex-direction: column; min-height: 100vh; }
  header { background: var(--dark); padding: 20px; display:flex; justify-content:center; box-shadow: 0 4px 10px rgba(0,0,0,0.4); }
  header img { height:90px; }
  main { flex:1; display:flex; justify-content:center; align-items:flex-start; padding:50px 20px; position:relative; }
  .wizard { background:var(--text-light); border-radius:var(--radius); box-shadow:0 8px 30px rgba(0,0,0,0.15); width:100%; max-width:720px; overflow:hidden; border:2px solid var(--accent); }
  .steps { display:flex; list-style:none; background:var(--dark); }
  .steps li { flex:1; padding:16px; text-align:center; font-weight:700; font-size:15px; color:var(--text-light); transition:background var(--transition); }
  .steps li.active, .steps li:hover { background:var(--gold-dark); color:var(--text-light); }
  .card { padding:40px; display:flex; flex-direction:column; min-height:600px; }
  .card h2 { font-family:var(--secondary-font); font-size:28px; margin-bottom:20px; text-align:center; color:var(--dark); }
  .card p { font-size:17px; line-height:1.6; margin-bottom:28px; text-align:center; }
  .details-table { width:100%; border-collapse:collapse; margin-bottom:30px; }
  .details-table td { padding:10px 14px; border:1px solid var(--accent); font-size:15px; }
  .scan-full { position:relative; border-radius:var(--radius); overflow:hidden; height:520px; background:#000; display:flex; align-items:center; justify-content:center; margin-bottom:30px; box-shadow:0 4px 20px rgba(0,0,0,0.3); }
  .scan-full::before { content:''; position:absolute; width:100%; height:100%; background:linear-gradient(90deg, rgba(176,142,76,0.2), rgba(176,142,76,0.05)); mix-blend-mode:screen; }
  .scan-full::after { content:''; position:absolute; width:100%; height:6px; background:var(--gold); top:0; left:0; animation:scanline 2.5s linear infinite; }
  @keyframes scanline { 0%{top:0;}100%{top:100%;} }
  .begin-btn { position:absolute; bottom:24px; left:50%; transform:translateX(-50%); background:var(--gold); border:none; color:var(--text-light); padding:16px 32px; border-radius:var(--radius); font-size:16px; font-weight:700; cursor:pointer; box-shadow:0 4px 10px rgba(0,0,0,0.3); transition:background var(--transition); }
  .begin-btn:hover { background:var(--gold-dark); }
  .review-floorplan { width:100%; max-height:460px; object-fit:contain; margin-bottom:28px; }
  .review-section { margin-bottom:28px; }
  .review-section label { font-weight:600; font-size:15px; margin-bottom:10px; display:block; }
  .review-section textarea { width:100%; padding:12px; border-radius:var(--radius); border:1px solid var(--accent); font-size:15px; margin-bottom:20px; }
  .buttons { display:flex; justify-content:center; gap:20px; margin-top:20px; }
  button { background:var(--gold); border:none; color:var(--text-light); padding:16px 36px; border-radius:var(--radius); cursor:pointer; font-size:16px; font-weight:700; transition:background var(--transition); }
  button:hover { background:var(--gold-dark); }
  footer { background:var(--dark); text-align:center; padding:16px; color:var(--text-light); font-size:14px; font-family:var(--secondary-font); }
  .help-widget { position:fixed; bottom:80px; right:24px; display:flex; flex-direction:column; gap:14px; }
  .help-widget button { background:var(--dark); color:var(--gold); padding:14px 18px; border-radius:var(--radius); font-size:14px; display:flex; align-items:center; gap:8px; box-shadow:0 2px 8px rgba(0,0,0,0.3); }
  .help-widget svg { width:18px; height:18px; fill:currentColor; }
  #overlay { display:none; position:fixed; top:0; left:0; width:100%; height:100%; background:#000; z-index:1000; align-items:center; justify-content:center; }
  #overlay .scan-full { width:100%; height:100%; border-radius:0; }
  #overlay .end-btn { position:absolute; bottom:40px; left:50%; transform:translateX(-50%); background:var(--gold); border:none; color:var(--text-light); padding:16px 32px; border-radius:var(--radius); font-size:18px; font-weight:700; cursor:pointer; box-shadow:0 4px 10px rgba(0,0,0,0.3); transition:background var(--transition); }
  #overlay .end-btn:hover { background:var(--gold-dark); }
</style>
</head>

let current = 0;
const card = document.getElementById('card');
const stepsEls = document.querySelectorAll('.steps li');
const overlay = document.getElementById('overlay');

function renderStep() {
  stepsEls.forEach((el,i) => el.classList.toggle('active', i===current));
  const s = steps[current];
  card.innerHTML = `<div><h2>${s.title}</h2><p>${s.text}</p>${s.content}</div>
    <div class="buttons">
      <button id="prevBtn" ${current===0?'disabled':''}>Back</button>
      <button id="nextBtn">${current===steps.length-1?'Start Over':'Next'}</button>
    </div>`;
  document.getElementById('prevBtn').onclick = () => { if(current>0) current--; renderStep(); };
  document.getElementById('nextBtn').onclick = () => {
    current = current < steps.length-1 ? current+1 : 0; renderStep();
  };
}

function startScan() {
  overlay.style.display = 'flex';
}

function endScan() {
  overlay.style.display = 'none';
  current = 2;
  renderStep();
}

function goToScan() {
  current = 1;
  renderStep();
}
